const DataandArchievesOfficer = () => {
    return (  
        <div className = 'archieves-officer'>
            <h1>Data and Archieves Officer</h1>

            <div>           
                <Link to = '/DirectorStudentSupportServices'><button className = 'previous-button'>Previous</button></Link>
                <Link to = '/AdmissionOfficer'><button className = 'next-button'>Next</button></Link>
            </div>
        </div>
    );
}
 
export default DataandArchievesOfficer;
